import React from 'react';
import { Collapse } from 'react-bootstrap';

 const Workspace = ({exploreOpen}) => {
    var checkmark =  '✓';  
 return ( 
     <div>
       <Collapse in={exploreOpen}>
          <div>
              <input type="text"  value="" /> {checkmark}
          </div>
      </Collapse>
     </div>
  )
};

export default Workspace;
